import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'

// Material-UI
import { withStyles } from '@material-ui/core/styles'
import { MuiThemeProvider } from '@material-ui/core/styles'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import Typography from '@material-ui/core/Typography'
import IconButton from '@material-ui/core/IconButton'
import Explore from '@material-ui/icons/Explore' // Discover
import FindReplace from '@material-ui/icons/FindReplace' // Filter
import PlaylistAdd from '@material-ui/icons/PlaylistAdd' // Integrate

import { Timeline } from 'react-material-timeline';
import { Avatar, Icon } from '@material-ui/core';

// Local
import Header from './Components/Header'
import HomeButton from './Components/HomeButton'
import theme from '../Assets/Theme'
import './About.css'

const axios = require('axios')
const url = 'http://whatsroaring-api.herokuapp.com/'

const styles = {
  largeIcon: {
    width: 60,
    height: 60,
  },
  font: {
    fontSize: 1.5,
  }
}

const events = [
  {
    title: 'Week 1',
    description: [ 'During the first week, our team worked on establishing a solid project overview plan. We articulated our goals and milestones.' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 2',
    subheader: new Date().toString(),
    description: [ 'Database design' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 3',
    subheader: new Date().toString(),
    description: [ 'backend: django and database setup; frontend: calendar setup' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 4',
    subheader: new Date().toString(),
    description: [ 'Split app into frontend and backend portions, worked on components' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 5',
    subheader: new Date().toString(),
    description: [ 'Filtering, ability to add events, viewing event details, graphic design' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 6',
    subheader: new Date().toString(),
    description: [ 'Expanded filtering abilities, fixed synchronization issues, debugging' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 7',
    subheader: new Date().toString(),
    description: [ 'Authentication, security for create events, debugging, design' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 8',
    subheader: new Date().toString(),
    description: [ 'Database design' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 9',
    subheader: new Date().toString(),
    description: [ 'Database design' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  },
  {
    title: 'Week 10',
    subheader: new Date().toString(),
    description: [ 'Presentation, ' ],
    icon: <Avatar><Icon></Icon></Avatar>,
  }
];

class Documentation extends Component {

  render() {
    const { classes } = this.props
    return (
      <div className='page'>
        <Header />

        <MuiThemeProvider theme={theme}>
          <div className='main'>
            <HomeButton />
            <div className='title'>
              <Typography variant="h3" color="primary">
                Team Documentation
              </Typography>
            </div>

            <Timeline events={events}/>
          </div>
        </MuiThemeProvider>
      </div>
    )
  }
}


export default withStyles(styles)(withRouter(Documentation))
